import "./App.css";
import { useState } from "react";

function App() {


  const [ item , setItem ] = new useState("hello");

  function update( e )
  {
    setItem( e.target.value );
  }


  return (
    <div className="App">
      <div className="card">
        <div className="title">
          <h1>TO DO LIST </h1>
        </div>

        <div className="additem">
          <input
            className="input"
            type="text"
            placeholder="Add items from here"
            onChange={update}
          />
          <button> + </button>
        </div>

        <div className="list">
          <ol>
            <li> {item} </li>
          </ol>
        </div>

        <div> hello </div>
      </div>
    </div>
  );
}
export default App;
